import logo from './logo.svg';
import './App.css';
import {BrowserRouter,Route,Routes} from 'react-router-dom';
import './Components/Navbar.js'
function App() {
  return (
   <BrowserRouter>
     <Navbar />

      <Routes>

        <Route path="/" element={
          <>
            <Banner/>
            <List/>
          </>
        }/>
        <Route path="/bot"  element={<Favourites/>}/>
      </Routes>
   </BrowserRouter>
  );
}

export default App;
